import React from 'react';
import homeimg from '../Images/homeimg.png';
import {NavLink} from 'react-router-dom';

const Card=()=>{
    return(
        <>
    <div className="card">
                <h2>Web development</h2>
                <img src={homeimg} alt="services1" className="serviceImg"/>
                <p>Lorem ipsum dolor sit amet consectetur 
                   adipisicing elit. Id, totam nesciunt! Nisi
                   explicabo possimus quasi deserunt blanditiis
                   assumenda doloribus in
                </p>
                <div className="btnBox">
                <div className="btn">
                <NavLink to="/about" className="readMore">Start Learning</NavLink>
                </div>
                </div>
            </div>
        </>
    )
}
export default Card;
